import React, { useState, useEffect } from "react";
import "./Dashboard.css";

const Dashboard = () => {
  const [activePanel, setActivePanel] = useState("Live News Feed");
  const [news, setNews] = useState([]);

  const API_KEY = "pub_788677aa36735d8282ee66b9146090ddf3d0f";

  useEffect(() => {
    const fetchNews = async () => {
      try {
        const response = await fetch(
          `https://newsdata.io/api/1/news?apikey=${API_KEY}&country=in&language=en`
        );
        const data = await response.json();

        // âœ… Strictly filter for country === 'IN'
        const filteredNews = (data.results || []).filter(
          (article) => article.country?.toLowerCase() === "in"
        );

        setNews(filteredNews);
        console.log("Fetched India news count:", filteredNews.length);
      } catch (err) {
        console.error("Failed to fetch news:", err);
        setNews([]);
      }
    };

    fetchNews();
  }, []);

  // ðŸ”¹ Generate AI Summary
  const generateAISummary = () => {
    if (news.length === 0) return ["No data to summarize."];
    return news.slice(0, 6).map((article) => {
      const title = article.title?.replace(/[^a-zA-Z0-9 ]/g, "");
      return `â€¢ ${title}`;
    });
  };

  // ðŸ”¹ Detect alert-related news
  const getAlerts = () => {
    const alertKeywords = [
      "alert",
      "emergency",
      "warning",
      "disaster",
      "evacuate",
      "flood",
      "fire",
      "storm",
    ];
    return news.filter((article) =>
      alertKeywords.some((keyword) =>
        (article.title + " " + article.description)
          .toLowerCase()
          .includes(keyword)
      )
    );
  };

  const aiSummary = generateAISummary();
  const recentAlerts = getAlerts();

  return (
    <div className="dashboard-container">
      <h1 className="dashboard-title">ðŸ“° India News Dashboard</h1>

      <div className="dashboard-panel-buttons">
        {["Live News Feed", "AI-Analysis Summary", "Recent Alerts Panel"].map(
          (panel) => (
            <button
              key={panel}
              className={`dashboard-button ${
                activePanel === panel ? "dashboard-active" : ""
              }`}
              onClick={() => setActivePanel(panel)}
            >
              {panel}
            </button>
          )
        )}
      </div>

      <div className="dashboard-panel-content">
        {activePanel === "Live News Feed" && (
          <div className="dashboard-news-feed">
            {news.length > 0 ? (
              news.slice(0, 6).map((article, idx) => (
                <div className="dashboard-news-card" key={idx}>
                  <h3>{article.title}</h3>
                  <p>{article.description?.slice(0, 100)}...</p>
                  <a
                    href={article.link}
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    Read More â†’
                  </a>
                </div>
              ))
            ) : (
              <p>No India-specific news found.</p>
            )}
          </div>
        )}

        {activePanel === "AI-Analysis Summary" && (
          <div className="dashboard-ai-panel">
            <h2>ðŸ§  AI-Based Analysis</h2>
            <ul className="ai-summary-list">
              {aiSummary.map((summary, idx) => (
                <li key={idx}>{summary}</li>
              ))}
            </ul>
          </div>
        )}

        {activePanel === "Recent Alerts Panel" && (
          <div className="dashboard-alert-panel">
            <h2>ðŸš¨ Recent Alerts</h2>
            {recentAlerts.length > 0 ? (
              recentAlerts.map((alert, idx) => (
                <div className="dashboard-alert-card" key={idx}>
                  <h4>{alert.title}</h4>
                  <p>{alert.description?.slice(0, 100)}...</p>
                  <a
                    href={alert.link}
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    Read More â†’
                  </a>
                </div>
              ))
            ) : (
              <p>No major alerts detected in India.</p>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
